\u0412\u043e\u043f\u0440\u043e\u0441 8.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Гарсон сделал группе комплимент, что так могут гулять только русские;
герои принялись объяснять разницу между украинцами и русскими. Кучма в
период своего президентства написал книгу "Украина - не Россия".

\u0412\u043e\u043f\u0440\u043e\u0441 6.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Velcro - слово-бумажник, образованное смешением двух других слов;
"portmanteau" переводится как "чемодан", "portmanteau word" -
слово-бумажник.
